import React from 'react';

const Song = props => {
    return (
        <div className="card" width="100" >
            <button type="button" onClick={props.onClick}>
                <img src="https://www.w3schools.com/images/picture.jpg" alt="Mountain" width="100" height="100" />
                {props.title}
            </button>
            <div className="title" >
                {props.title}
            </div>
        </div>
    );
}

export default Song;
